using OLS.Casy.Core.Api;
using OLS.Casy.Core.Logging.Api;
using OLS.Casy.IO.Api;
using OLS.Casy.Models;
using OLS.Casy.Models.Enums;
using System;
using System.Collections.Generic;
using System.ComponentModel.Composition;
using System.Linq;
using System.Threading.Tasks;

namespace OLS.Casy.Core.Authorization.Local
{
    /// <summary>
    /// Implementation of <see cref="IAuthenticationProvider"/>.
    /// Uses local database access to load and store authentication information.
    /// </summary>
    [PartCreationPolicy(CreationPolicy.Shared)]
    [Export(typeof(LocalAuthenticationProvider))]
    public class LocalAuthenticationProvider
    {
        private readonly IDatabaseStorageService _databaseStorageService;
        private readonly IEncryptionProvider _encryptionProvider;
        private readonly ILogger _logger;
        private readonly IList<User> _userList;
        private readonly IList<UserRole> _roleList;

        /// <summary>
        /// MEF importing constructor
        /// </summary>
        /// <param name="databaseStorageService">Implementation of <see cref="IDatabaseStorageService"/></param>
        /// <param name="logger">Implementation of <see cref="ILogger"/></param>
        /// <param name="encryptionProvider">Implementation of <see cref="IEncryptionProvider"/></param>
        [ImportingConstructor]
        public LocalAuthenticationProvider(IDatabaseStorageService databaseStorageService,
            ILogger logger, IEncryptionProvider encryptionProvider)
        {
            this._databaseStorageService = databaseStorageService;
            this._logger = logger;
            this._encryptionProvider = encryptionProvider;

            this._roleList = new List<UserRole>();
            this._userList = new List<User>();
        }

        /// <summary>
        ///     List of known users
        /// </summary>
        public IEnumerable<User> UsersList
        {
            get { return _userList; }
        }

        /// <summary>
        ///     List of known user roles
        /// </summary>
        public IEnumerable<UserRole> RolesList
        {
            get { return _roleList; }
        }

        /// <summary>
        ///     Returns the default role
        /// </summary>
        public UserRole DefaultRole
        {
            get { return _roleList.FirstOrDefault(item => item.Id == 1); }
        }

        /// <summary>
        ///     Creates a new User with the passed identity and password
        /// </summary>
        /// <param name="userToCreate">Identity of the new user</param>
        /// <param name="password">Password of the new user</param>
        /// <returns>The newly created user</returns>
        public User CreateUser(string username, string password = null)
        {
            if (string.IsNullOrEmpty(username))
            {
                return null;
            }

            if (this.TryGetUser(username) != null)
            {
                throw new ArgumentException("User ID already exists.");
            }

            string encryptedPassword;
            if (string.IsNullOrEmpty(password))
            {
                encryptedPassword = string.Empty;
            }
            else
            {
                encryptedPassword = _encryptionProvider.EncryptPassword(password);
            }

            var newUser = new User(username, _roleList.FirstOrDefault(item => item.Priority == 1));
            newUser.Password = encryptedPassword;
            newUser.FindRoleDelegate = FindRoleByName;
            newUser.ForceCreatePassword = string.IsNullOrEmpty(encryptedPassword);
            
            SaveUser(newUser);

            this._userList.Add(newUser);
            this._logger.Info(LogCategory.UserManagement, string.Format("New user '{0}' created", newUser.Identity.Name));
            return newUser;
        }

        public void DeleteUser(User user)
        {
            this._logger.Info(LogCategory.UserManagement, string.Format("User '{0}' deleted", user.Identity.Name));
            this._userList.Remove(user);
            _databaseStorageService.DeleteUser(user);
            
        }

        /// <summary>
        ///     Try to get a known user by identity (username)
        /// </summary>
        /// <param name="identityToFind">Identity/Username of the user</param>
        /// <returns>The user with the passed identity</returns>
        public User TryGetUser(string identityToFind)
        {
            if(this._userList.Count == 0)
            {
                this.LoadUserList();
            }

            foreach (User user in this._userList)
            {
                if (user.Identity.Name.Equals(identityToFind))
                {
                    return user;
                }
            }
            return null;
        }

        /// <summary>
        ///     Loads the list of user
        /// </summary>
        public void LoadUserList()
        {
            _roleList.Clear();
            var userRoles = _databaseStorageService.GetUserRoles();
            foreach(var role in userRoles)
            {
                _roleList.Add(role);
            }

            if(_roleList.Count == 0)
            {
                InitDefaultRoles();
            }

            _userList.Clear();
            var users = _databaseStorageService.GetUsers();

            foreach (var user in users)
            {
                _userList.Add(user);
            }

            if(_userList.Count == 0)
            {
                InitDefaultUsers();
            }
        }

        /// <summary>
        ///     Saves async the list of currently known user
        /// </summary>
        /// <returns></returns>
        public async Task SaveChanges()
        {
            await Task.Factory.StartNew(() =>
            {
                var users = _userList.OfType<User>();
                foreach (var user in users)
                {
                    SaveUser(user);
                }
            });
        }

        public void RejectChanges()
        {
            LoadUserList();
        }

        public void SaveUser(User user)
        {
            _databaseStorageService.SaveUser(user);
        }

        /// <summary>
        ///     Changes the password for the passed user
        /// </summary>
        /// <param name="user">User the password shall be changed for</param>
        /// <param name="currentPassword">Current password</param>
        /// <param name="newPassword">New password</param>
        /// <returns>True, if the operation was successful, false otherwise</returns>
        public bool ChangePassword(User user, string currentPassword, string newPassword)
        {
            if (user != null && CheckPassword(user, currentPassword))
            {
                user.Password = _encryptionProvider.EncryptPassword(newPassword);
                user.ForceCreatePassword = false;
                SaveUser(user);
                return true;
            }
            return false;
        }

        /// <summary>
        ///     Checks the correctness of the passed combination of username and password
        /// </summary>
        /// <param name="user">Identity of the user</param>
        /// <param name="password">Password to be checked</param>
        /// <returns></returns>
        public bool CheckPassword(User user, string password)
        {
            if(user.ForceCreatePassword)
            {
                return true;
            }
            var decrypted = _encryptionProvider.DecryptPassword(user.Password);

            return decrypted == password;
        }

        private UserRole FindRoleByName(string name)
        {
            return this._roleList.FirstOrDefault(item => item.Name == name);
        }

        private void InitDefaultRoles()
        {
            this._roleList.Add(new UserRole() { Name = "User", Priority = 1 });
            this._roleList.Add(new UserRole() { Name = "Operator", Priority = 2 });
            this._roleList.Add(new UserRole() { Name = "Supervisor", Priority = 3 });
            
            foreach(var role in _roleList)
            {
                _databaseStorageService.SaveUserRole(role);
            }
        }

